import { MDBIcon } from "mdbreact";
import p from '../../img/profile.png';
import { makeStyles } from '@material-ui/core/styles';
import Input from '@material-ui/core/Input';
import LockOutlinedIcon from '@material-ui/icons/LockOutlined';
import React from 'react';
import { connect } from 'react-redux';
import Button from '@material-ui/core/Button';
import { signIn } from '../../store/actions/signIn';

const useStyles = makeStyles((theme) => ({
  root: {
    '& > *': {
      margin: theme.spacing(1),
    },
  },
}));


const SignIn = (props) => {
  const classes = useStyles();
  let email = "";
  let password = "";
  return (<>
    <form className={classes.root} noValidate autoComplete="off">
      <img className='profile_img' src={p}>
      </img>
      <MDBIcon icon="envelope-square" />
      <Input style={{ "display": "inline-block" }} placeholder="Email" inputProps={{ 'aria-label': 'description' }} onChange={(e) => { email = e.target.value }} required="true" />
      <br />
      <LockOutlinedIcon />
      <Input style={{ "display": "inline-block" }} placeholder="Password" inputProps={{ 'aria-label': 'description' }} onChange={(e) => { password = e.target.value }} required="true" />
      <br />
      <Button variant="contained" color="pink" onClick={() => signIn(password, email)}>Login</Button>
    </form>
  </>
  );
}




export default SignIn;
